// Desktop.tsx
import React, { useState } from "react";
import Workout from "./Components/Cards";
import NavBar from "./Components/NavBar";
import WorkoutDetails from "./Components/WorkoutDetails";

const Desktop: React.FC = () => {
  const [selectedWorkout, setSelectedWorkout] = useState<string | null>(null);

  const workoutData = [
    { id: 1, title: 'Workout 1', description: 'This is workout 1 consisting of Workouts', image: './images/Workout1.jpg', onClickPlan: () => handleWorkoutClick('Workout 1') },
    { id: 2, title: 'Workout 2', description: 'This is workout 2 consisting of Workouts', image: './images/Workout1.jpg', onClickPlan: () => handleWorkoutClick('Workout 2') },
    { id: 3, title: 'Workout 3', description: 'This is workout 3 consisting of Workouts', image: './images/Workout1.jpg', onClickPlan: () => handleWorkoutClick('Workout 3') },
    // Add more workout data as needed
  ];

  const handleWorkoutClick = (workoutName: string) => {
    setSelectedWorkout(workoutName);
  };

  const navigateBackToDesktop = () => {
    setSelectedWorkout(null);
  };

  return (
    <div>
      <NavBar onNavigateBack={navigateBackToDesktop} />
      <div style={{ display: 'flex', justifyContent: 'center', padding: '20px', flexWrap: 'wrap' }}>
        {workoutData.map((workout) => (
          <Workout key={workout.id} {...workout} />
        ))}
      </div>
      {selectedWorkout && (
        <WorkoutDetails workoutName={selectedWorkout} />
      )}
    </div>
  );
};

export default Desktop;
